import axios from 'axios';


const clientId = 'AWpNE_nkwNP-p_EKVfFC7dSiCuCCuz_-UUg2P7vJkP9BZud1ehgpeBOsJINOHp6rpivbc-N6bnSE3FtK';
const clientSecret = 'EBWPUpVAXq14I7vMccN5nG0hMc97VScXLS9d1Yu_pToTtqmAl94RHzyMjfi4bh1tVazpj_-H9Pi74CmY';


export const getAccessToken = async () => {
  const auth = Buffer.from(`${clientId}:${clientSecret}`).toString('base64');
  try {
    const response = await axios.post('https://api-m.sandbox.paypal.com/v1/oauth2/token', 'grant_type=client_credentials', {
      headers: {
        Authorization: `Basic ${auth}`,
        'Content-Type': 'application/x-www-form-urlencoded',
      },
    });
    return response.data.access_token;
  } catch (error) {
    console.error('Error obtaining PayPal access token:', error);
    throw new Error('Could not obtain access token');
  }
};

export const createOrder = async () => {
  const accessToken = await getAccessToken();
  try {
    const response = await axios.post('https://api-m.sandbox.paypal.com/v2/checkout/orders', {
      intent: 'CAPTURE',
      purchase_units: [{
        amount: {
          currency_code: 'USD',
          value: '1.00',
        },
      }],
    }, {
      headers: {
        Authorization: `Bearer ${accessToken}`,
        'Content-Type': 'application/json',
      },
    });
    return response.data;
  } catch (error) {
    console.error('Error creating PayPal order:', error);
    throw new Error('Could not create PayPal order');
  }
};

